Hi,
@aselle can you educate me more about inception5h. I would like to know why there is a time difference between inceptionV3 and inception5h models(Like why is it not inceptionV5, why is it not listed in the models list [here](https://github.com/tensorflow/models/tree/master/slim), is inceptionV5 retrained on some other models like inceptionV3?). 

As @left13 mentioned, even I am able to run the demo(5h model) at 170ms-450ms on each prediction on OnePlus3T device and my [retrained](https://github.com/tensorflow/tensorflow/blob/master/tensorflow/examples/image_retraining/retrain.py) &[optimized](https://github.com/tensorflow/tensorflow/blob/master/tensorflow/python/tools/optimize_for_inference.py) v3 at 1500ms-2100ms

@left13 I tried [eight-bit calculations](https://github.com/tensorflow/tensorflow/blob/master/tensorflow/tools/graph_transforms/README.md#eight-bit-calculations). The inference time has slightly improved to 1200ms~1500ms, but the classification part dosent work, for any image you pass, it shows a constant output(Tested on OnePlus3T device).

I understand from my experiments that after quantization or [eight-bit calculations](https://github.com/tensorflow/tensorflow/blob/master/tensorflow/tools/graph_transforms/README.md#eight-bit-calculations), the size of APK/model has decreased from 82.1 MB to 19.6MB but the result is same:"Image classification dosent work"

Is it possible to retrain inception5h model on my own data?
